import React, { Component } from 'react';

class Blogs extends Component {
  state = {};

  render() {
    const { markdown } = this.state;
    return (
      <div className="blogs">
        <h1>Blogs</h1>
        <div>
          <h2>Preview here</h2>
          <div
            contentEditable
          >
            <p>start your blog here</p>
          </div>
        </div>
      </div>
    );
  }
}

export default Blogs;
